import './Register.css';
export default function Register() {
    const [input,setinput]=useState('')
    const setRegister=(event)=>{
        // event.preventDefault();
        const{name,value}=event.target
        setinput({
          ...input,[name]:value
        })
        }
  return (
   <>
   <form  >
             <div className='facebook'>
                <div className='row'>
             
             <div className='fb'>
                <input type="text" placeholder='User name'name="name"value={input.name||""} required id="in"/><br /><br />
                <input type="email" placeholder='email'name="email" value={input.name||""}/><br/><br/>

                <input type="password" placeholder='password'name="password"v  required id="in"/><br/><br/>
                <input type="password again" placeholder='password again 'name="passwordagain"  required id="in"/><br /><br />
                <input type="button" value="Sign Up" required id="btn"/><br />
                <input type="submit" value="Log into Account"required id="bttn" />
             </div>
</div></div>
</form>
   </>
  )
}
